import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Users() {
    const [users, setUsers] = useState([]);
    const [username, setUsername] = useState('');
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [dateOfBirth, setDateOfBirth] = useState('');
    const [email, setEmail] = useState('');

    useEffect(() => {
        fetchUsers();
    }, []);

    const fetchUsers = async () => {
        try {
            const response = await axios.get('http://localhost:3001/users');
            setUsers(response.data);
        } catch (error) {
            console.error("Error fetching users", error);
        }
    };

    const addUserHandler = async () => {
        try {
            await axios.post('http://localhost:3001/users', { username, firstName, lastName, dateOfBirth, email });
            fetchUsers();
            setUsername('');
            setFirstName('');
            setLastName('');
            setDateOfBirth('');
            setEmail('');
        } catch (error) {
            console.error("Error adding user", error);
        }
    };

    const deleteUserHandler = async (userId) => {
        try {
            await axios.delete(`http://localhost:3001/users/${userId}`);
            fetchUsers();
        } catch (error) {
            console.error("Error deleting user", error);
        }
    };

    // CSS Styles
    const inputStyle = {
        padding: '10px',
        borderRadius: '5px',
        margin: '0 10px 20px 0',
        fontSize: '18px',
        width: 'calc(30% - 10px)'
    };

    const buttonStyle = {
        padding: '10px 15px',
        borderRadius: '5px',
        backgroundColor: '#3498db',
        color: 'white',
        border: 'none',
        cursor: 'pointer',
        marginRight: '10px'
    };

    const titleStyle = {
        borderBottom: '2px solid #3498db',
        paddingBottom: '10px',
        marginTop: '20px'
    };
        // Updated CSS Styles
        const tableStyle = {
            width: '100%',
            marginTop: '20px',
            borderCollapse: 'collapse',
        };

        const tableHeaderStyle = {
            backgroundColor: '#3498db',
            color: 'white',
            fontWeight: 'bold',
            padding: '10px 15px',
            borderBottom: '2px solid #2980b9',
        };

        const tableRowStyle = {
            borderBottom: '1px solid #ccc',
        };

        const tableDataStyle = {
            padding: '10px 15px',
            textAlign: 'left',
        };

    return (
        <div>
            <h3 style={titleStyle}>Existing Users</h3>
<table className="users-table" style={{ width: '100%' }}>
    <thead>
        <tr>
            <th style={{ fontSize: '20px' }}>Name</th>
            <th style={{ fontSize: '20px' }}>Username</th>
            <th style={{ fontSize: '20px' }}>Date of Birth</th>
            <th style={{ fontSize: '20px' }}>Phone</th>
            <th style={{ fontSize: '20px' }}>Email</th>
            <th style={{ fontSize: '20px' }}>Actions</th>
        </tr>
    </thead>
    <tbody>
        {userData.map((user) => (
            <tr key={user.id}>
                <td style={{ fontSize: '20px' }}>{user.name}</td>
                <td style={{ fontSize: '20px' }}>{user.username}</td>
                <td style={{ fontSize: '20px' }}>{user.dob}</td>
                <td style={{ fontSize: '20px' }}>{user.phone}</td>
                <td style={{ fontSize: '20px' }}>{user.email}</td>
                <td>
                    <button style={{ ...buttonStyle, backgroundColor: 'red' }} onClick={() => deleteUserHandler(user.id)}>
                        Delete
                    </button>
                </td>
            </tr>
        ))}
                </tbody>
            </table>
        </div>
    );
}

export default Users;
